import React from 'react';
import "../Asserts/Css/Pages/whatwedo.css";
import Header from '../Components/header';
import Footer from '../Components/footer';
import Navbar from '../Components/navbar';
import StudyAbroad from '../Components/StudyAbroad';
import YourNextStep from '../Components/YourNextStep';

const CourseAdvice = ()=>{
    return (
        <div className='courseadvicepage'>
            <h1>course advice to find what’s best for you IIEC</h1>
            <h2>We’ll help you find the perfect course that best suits your career goals</h2>
            <p>Whether you’re still considering possible courses, tossing up between two fields of study or have no idea what kind of career you want, we can help you find the best course and coordinate your university application. </p>
            <h2>Let’s find your best fit </h2>
            <p>With so many courses and universities to choose from, deciding where and what to study abroad can be a daunting task. Don’t worry, we are here to hand-hold you during the entire process. Our teams are backed by a sophisticated knowledge matching system that contains all the latest information on our partner institutions, including schools, English language colleges, vocational colleges, and universities. </p>
            <h2>We work on your dream goals </h2>
            <p>It may seem obvious, but your education, experiences and topics of interest are the first steps to finding your dream course. Also, your chosen course should put you on a path to a profession you’ll love for life. Your IIEC counsellor will work with you to shortlist a range of courses and dive down deep into the detail of course handbooks and subject choices. Once you decide on the course of your dreams, we’ll help you to shortlist the perfect destination and educational institution for you. </p>
            <h2>Struggling to choose a course? find the right one</h2>
            <h2>Consider the timelines and budgets</h2>
            <p>Knowing how much a course will cost and how much you can afford to spend on your education are significant factors in choosing where and what to study. </p>
            <p>Carefully consider the academic year you wish to enrol in and the intake you want to apply for. Remember, every country has its own intake and you need to time your application process </p>
            <h2>Explore study abroad intakes</h2>


        </div>

    )
}
export default CourseAdvice ;
